  local function GetExpansion()
  local _, _, _, client = GetBuildInfo()
  client = client or 11200

  -- detect client expansion
  if client >= 20000 and client <= 20400 then
    return "tbc"
  elseif client >= 30000 and client <= 30300 then
    return "wotlk"
  else
    return "vanilla"
  end
end

if GetExpansion() == "tbc" then
  for k,v in pairs(data_tbc) do data[k] = v end
end

local function GetItemLinkByName(name)
  for itemID = 1, 25818 do
    local itemName, hyperLink, itemQuality = GetItemInfo(itemID)
    if (itemName and itemName == name) then
      local _, _, _, hex = GetItemQualityColor(tonumber(itemQuality))
      return hex.. "|H"..hyperLink.."|h["..itemName.."]|h|r"
    end
  end
end

local function CreateGoldString(money)
  local gold = floor(money/ 100 / 100)
  local silver = floor(mod((money/100),100))
  local copper = floor(mod(money,100))

  local string = ""
  if gold > 0 then string = string .. "|cffffffff" .. gold .. "|cffffd700g" end
  if silver > 0 then string = string .. "|cffffffff " .. silver .. "|cffc7c7cfs" end
  string = string .. "|cffffffff " .. copper .. "|cffeda55fc"

  return string
end

local function AddVendorPrices(frame, id, count)
  if data[id] then
    local _, _, sell, buy = strfind(data[id], "(.*),(.*)")
    sell = tonumber(sell)
    buy = tonumber(buy)

    if not MerchantFrame:IsShown() then
      if sell > 0 then SetTooltipMoney(frame, sell * count) end
    end

    if IsShiftKeyDown() then
      frame:AddLine(" ")

      if count > 1 then
        frame:AddDoubleLine("Sell:", CreateGoldString(sell) .. "|cff555555  //  " .. CreateGoldString(sell*count), 1, 1, 1);
      else
        frame:AddDoubleLine("Sell:", CreateGoldString(sell * count), 1, 1, 1);
      end

      if count > 1 then
        frame:AddDoubleLine("Buy:", CreateGoldString(buy) .. "|cff555555  //  " .. CreateGoldString(buy*count), 1, 1, 1);
      else
        frame:AddDoubleLine("Buy:", CreateGoldString(buy), 1, 1, 1);
      end
    end
    frame:Show()
  end
end

local ShaguValue = CreateFrame( "Frame" , "ShaguValueGameTooltip", GameTooltip )

ShaguValue:SetScript("OnHide", function()
  GameTooltip.itemLink = nil
  GameTooltip.itemCount = nil
end)

ShaguValue:SetScript("OnShow", function()
  if GameTooltip.itemLink then
    local _, _, id = string.find(GameTooltip.itemLink, "item:(%d+):%d+:%d+:%d+")
    local count = GameTooltip.itemCount or 1
    AddVendorPrices(GameTooltip, tonumber(id), count)
  end
end)

local HookSetItemRef = SetItemRef
SetItemRef = function(link, text, button)
  local item, _, id = string.find(link, "item:(%d+):.*")
  HookSetItemRef(link, text, button)
  if not IsAltKeyDown() and not IsShiftKeyDown() and not IsControlKeyDown() and item then
    AddVendorPrices(ItemRefTooltip, tonumber(id), 1)
  end
end

